import React from 'react';

import './card1.scss';

type Props = JSX.IntrinsicElements['div'] & {
    title?: string;
    width?: number;
}

const Card1 : React.FC<Props> = ({
    title,
    width,
    ...rest
}) => { 
    return(
        <div className="input-area" {...rest}>

        </div>
    );
}

export default Card1;
